import React, { useEffect, useState } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, colors } from '@mui/material';
import { useTheme} from "@mui/material";
import { tokens } from "../theme";


const NeoTable = () => {
    const theme = useTheme();
    const colors = tokens(theme.palette.mode);

    const [dataArray, setDataArray] = useState([]);
    useEffect(() => {
    // Function to fetch data from the server
    const fetchData = async () => {
      try {
      
        const response = await fetch('http://localhost:10000/getSunData');

        if (!response.ok) {
          throw new Error('Network response was not ok');
        }

        const data = await response.json();
        setDataArray(data.sunData);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);
      

  return (
    <TableContainer component={Paper}>
      <Table aria-label="simple table">
        <TableHead style={{color:colors.redAccent[900]}}>
          <TableRow  sx={{
            "& th": {
            backgroundColor: colors.primary[200]
        }
    }}> 
            <TableCell align="left">id</TableCell>
            <TableCell align="left">Designation</TableCell>
            <TableCell align="left">Orbit ID</TableCell>
            <TableCell align="left">Close-approach</TableCell>
            <TableCell align="left">Distance (AU)</TableCell>
            <TableCell align="left">Minimum approach distance (AU)</TableCell>
            <TableCell align="left">Maximum approach distance (AU)</TableCell>
            <TableCell align="left">Velocity</TableCell>
            <TableCell align="left">Magnitude</TableCell>
          </TableRow>
        </TableHead>
        {/* <TableBody>
          {dataArray.map((item, index) => (
            <TableRow key={index}>
              <TableCell component="th" scope="row">
                {item.date}
              </TableCell>
              <TableCell align="right">{item.ra}</TableCell>
              <TableCell align="right">{item.dec}</TableCell>
              <TableCell align="right">{item.mag}</TableCell>
              <TableCell align="right">{item.diameter}</TableCell>
            </TableRow>
          ))}
        </TableBody> */}
      </Table>
    </TableContainer>
  );
};


export default NeoTable;
